define('text!modules/admin/system/components/edit-client-form.html', ['module'], function(module) { module.exports = "<template>\n\t<div id=\"home\" class=\"tab-pane fade active in\">\n\t\t<div class=\"bottomMargin topMargin list-group-item leftMargin rightMargin\">\n\t\t\t<span click.delegate=\"backClient()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\"\n\t\t\t data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\n\t\t\t<span click.delegate=\"saveClient()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\"\n\t\t\t data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\n\t\t</div>\n\n\t\t<fieldset>\n\t\t\t<div class=\"col-lg-12\">\n\t\t\t\t<div class=\"form-group\">\n\t\t\t\t\t<label for=\"client\" class=\"col-lg-2 control-label topMargin\">Client</label>\n\t\t\t\t\t<div class=\"col-lg-10\">\n\t\t\t\t\t\t<input disabled.bind=\"selectedClient.assignments.length > 0\" value.bind=\"selectedClient.client\" id=\"client\" class=\"form-control topMargin\" placeholder=\"Product\" type=\"text\"\n\t\t\t\t\t\t/>\n\t\t\t\t\t</div>\n\t\t\t\t</div>\n\t\t\t\t<div class=\"form-group\">\n\t\t\t\t\t<label for=\"idsavaialble\" class=\"col-lg-2 control-label topMargin\">IDs Available</label>\n\t\t\t\t\t<div class=\"col-lg-10\">\n\t\t\t\t\t\t<input disabled.bind=\"selectedClient.assignments.length > 0\" value.bind=\"selectedClient.idsAvailable\" id=\"idsavaialble\"\n\t\t\t\t\t\t class=\"form-control topMargin\" placeholder=\"IDs Available\" type=\"number\" />\n\t\t\t\t\t</div>\n\t\t\t\t</div>\n\t\t\t\t<div class=\"form-group\">\n\t\t\t\t\t<label for=\"lastID\" class=\"col-lg-2 control-label topMargin\">Last ID Assigned</label>\n\t\t\t\t\t<div class=\"col-lg-10\">\n\t\t\t\t\t\t<input value.bind=\"selectedClient.lastIdAssigned\" id=\"lastID\" class=\"form-control topMargin\" placeholder=\"Last ID Allocated\"\n\t\t\t\t\t\t type=\"number\" />\n\t\t\t\t\t</div>\n\t\t\t\t</div>\n\t\t\t\t<div class=\"form-group\">\n\t\t\t\t\t<label for=\"status\" class=\"col-lg-2 control-label topMargin\">Status</label>\n\t\t\t\t\t<div class=\"col-lg-10\">\n\t\t\t\t\t\t<select value.bind=\"selectedClient.clientStatus\" class=\"form-control topMargin\" id=\"status\">\n\t\t\t\t\t\t\t<option value=\"\">Select an option</option>\n\t\t\t\t\t\t\t<option repeat.for=\"name of config.CLIENT_STATUSES\" value=\"${name.code}\">${name.description}</option>\n\t\t\t\t\t\t</select>\n\t\t\t\t\t</div>\n\t\t\t\t</div>\n\t\t\t</div>\n\t\t</fieldset>\n\t</div>\n</template>"; });
define('text!modules/admin/system/components/is4ua.html', ['module'], function(module) { module.exports = "<template>\n    <div class=\"col-lg-6\">\n        <div class=\"form-group\">\n            <label for=\"editSapName\" class=\"control-label\">SAP Name</label>\n            <select value.two-way=\"products.selectedProduct.sapProduct\" id=\"editSapName\" class=\"form-control \" placeholder=\"SAP Name\">\n                <option value=\"\">Select an option</option>\n                <option repeat.for=\"name of is4ua.sapProductsArray\" value=\"${name.code}\">${name.description}</option>\n            </select>\n        </div>\n        <div class=\"form-group\">\n            <label for=\"editHostedWhere\" class=\"control-label\">Hosted</label>\n            <select value.bind=\"products.selectedProduct.hostWhere\" id=\"editHostedWhere\" class=\"form-control \">\n                <option value=\"\">Select an option</option>\n                <option value=\"UCC\">UCC</option>\n                <option value=\"Other\">Other</option>\n            </select>\n        </div>\n    \n        <div class=\"form-group\">\n            <label for=\"editUaCurriculum\" class=\"control-label\">UA Curriculum</label>\n            <select value.bind=\"products.selectedProduct.uaCurriculum\" id=editUaCurriculum \" class=\"form-control  \">\n                <option value=\" \">Select an option</option>\n                <option repeat.for=\"name of is4ua.uaCurriculumArray \" value=\"${name.code} \">${name.description}</option>\n            </select>\n        </div>\n    </div>\n</template>"; });
